import React, { useState, useEffect } from 'react';
import '../../App.css';
import './Mentions.css';

class Mentions extends React.Component{

    render(){

        return(
            <body id="Mentions">
                Mentions légales
                <div id="Content">
                    <div className="Informations">
                        Noms et prénoms
                        <div id="names">
                            <ul>
                                <li>Christopher Fauconnier</li>
                                <li>Diego Martin Lenoir</li>
                                <li>Simon Périquet</li>
                                <li>Simon Kinet</li>
                            </ul>
                        </div>
                    </div>

                </div>

            </body>

        )
    }


}

export default Mentions;
